import React, { useEffect } from 'react';
import { useSelector, useDispatch } from 'react-redux';
import { searchSlice } from '../redux/searchSlice';

//Components Provided by MUI

import Box from '@mui/material/Box';
import FormGroup from '@mui/material/FormGroup';
import FormControlLabel from '@mui/material/FormControlLabel';
import Checkbox from '@mui/material/Checkbox';
import { useTheme } from '@mui/material/styles';







export default function DetailSearch(props) {

    const theme = useTheme();
    const dispatch = useDispatch();
    let detailBoxToggle = useSelector(state => state.searchSlice.isDetailBoxOpened);
    let useGoogle = useSelector(state => state.searchSlice.useGoogle);
    let useHotPepper = useSelector(state => state.searchSlice.useHotPepper);
    let parking,card,eatfree,drinkfree,privateroom = false;


    const handlechange = (e) => {
        dispatch(searchSlice.actions.setHotPepperDetail({
            parking : true,
            eatfree : true,
            drinkfree : true,
            privateroom : true,
            card : true
        }));
    }


    return (
        <Box
            sx={{
                width: 300,
                height: 220,
                backgroundColor: 'white',
                boxShadow: 3,
                position: 'absolute',
                zIndex: 1000,
                borderRadius: theme.shape.borderRadius,
                display: detailBoxToggle ? 'block' : 'none',
            }}
        >
            <FormGroup>
                <FormControlLabel value={eatfree} onChange={handlechange} disabled={useGoogle || !useHotPepper} control={<Checkbox />} label="食べ放題" />
                <FormControlLabel value={drinkfree} onChange={handlechange} disabled={useGoogle || !useHotPepper} control={<Checkbox />} label="飲み放題" />
                <FormControlLabel value={privateroom} onChange={handlechange} disabled={useGoogle || !useHotPepper} control={<Checkbox />} label="個室あり" />
                <FormControlLabel value={card} onChange={handlechange} disabled={useGoogle || !useHotPepper} control={<Checkbox />} label="カード可" />
                <FormControlLabel value={parking} onChange={handlechange} disabled={useGoogle || !useHotPepper} control={<Checkbox />} label="駐車場あり" />
            </FormGroup>

        </Box>

    )


}
